  identify, describe and map the extent and diversity of riparian habitats found along
  the main stem of the San Joaquin River, to document the diversity and distribution
  of plant species, both native and introduced, to locate and map invasive exotic
  vegetation, and to provide necessary information toward the development of a map
  of restoration potential along the river.\",\n\t\"license_title\": null,\n\t\"extras\":
